@import "./variables";

/* https://materialtheme.arcsine.dev */

/**
* Generated theme by Material Theme Generator
* https://materialtheme.arcsine.dev
*/


@import "~@angular/material/theming";
// Include the common styles for Angular Material. We include this here so that you only
// have to load a single css file for Angular Material in your app.




// Fonts
@import "https://fonts.googleapis.com/css?family=Material+Icons";
@import url("https://fonts.googleapis.com/css?family=Roboto:300,400,500");

$fontConfig: (
  display-4:
    mat-typography-level(112px, 112px, 300, Roboto, -0.0134em),
  display-3:
    mat-typography-level(56px, 56px, 400, Roboto, -0.0089em),
  display-2: mat-typography-level(45px, 48px, 400, Roboto, 0em),
  display-1: mat-typography-level(34px, 40px, 400, Roboto, 0.0074em),
  headline: mat-typography-level(24px, 32px, 400, Roboto, 0em),
  title: mat-typography-level(20px, 32px, 400, Roboto, 0.0075em),
  subheading-2:
    mat-typography-level(14px, 28px, 400, Roboto, 0.0094em),
  subheading-1:
    mat-typography-level(15px, 24px, 500, Roboto, 0.0067em),
  body-2: mat-typography-level(14px, 24px, 500, Roboto, 0.0179em),
  body-1: mat-typography-level(14px, 20px, 400, Roboto, 0.0179em),
  button: mat-typography-level(14px, 14px, 400, Roboto, 0.0893em),
  caption: mat-typography-level(12px, 20px, 400, Roboto, 0.0333em),
  input: mat-typography-level(inherit, 1.125, 400, Roboto, 1.5px),
);

// Foreground Elements

// Light Theme Text
$dark-text: #000000;
$dark-primary-text: rgba($dark-text, 0.87);
$dark-accent-text: rgba($dark-primary-text, 0.54);
$dark-disabled-text: rgba($dark-primary-text, 0.38);
$dark-dividers: rgba($dark-primary-text, 0.12);
$dark-focused: rgba($dark-primary-text, 0.12);

$mat-light-theme-foreground: (
  base: black,
  divider: $dark-dividers,
  dividers: $dark-dividers,
  disabled: $dark-disabled-text,
  disabled-button: rgba($dark-text, 0.26),
  disabled-text: $dark-disabled-text,
  elevation: black,
  secondary-text: $dark-accent-text,
  hint-text: $dark-disabled-text,
  accent-text: $dark-accent-text,
  icon: $dark-accent-text,
  icons: $dark-accent-text,
  text: $dark-primary-text,
  slider-min: $dark-primary-text,
  slider-off: rgba($dark-text, 0.26),
  slider-off-active: $dark-disabled-text,
);

// Dark Theme text
$light-text: #ffffff;
$light-primary-text: $light-text;
$light-accent-text: rgba($light-primary-text, 0.7);
$light-disabled-text: rgba($light-primary-text, 0.5);
$light-dividers: rgba($light-primary-text, 0.12);
$light-focused: rgba($light-primary-text, 0.12);

$mat-dark-theme-foreground: (
  base: $light-text,
  divider: $light-dividers,
  dividers: $light-dividers,
  disabled: $light-disabled-text,
  disabled-button: rgba($light-text, 0.3),
  disabled-text: $light-disabled-text,
  elevation: black,
  hint-text: $light-disabled-text,
  secondary-text: $light-accent-text,
  accent-text: $light-accent-text,
  icon: $light-text,
  icons: $light-text,
  text: $light-text,
  slider-min: $light-text,
  slider-off: rgba($light-text, 0.3),
  slider-off-active: rgba($light-text, 0.3),
);

// Background config
// Light bg
$light-background: #fafafa;
$light-bg-darker-5: darken($light-background, 5%);
$light-bg-darker-10: darken($light-background, 10%);
$light-bg-darker-20: darken($light-background, 20%);
$light-bg-darker-30: darken($light-background, 30%);
$light-bg-lighter-5: lighten($light-background, 5%);
$dark-bg-tooltip: lighten(#2c2c2c, 20%);
$dark-bg-alpha-4: rgba(#2c2c2c, 0.04);
$dark-bg-alpha-12: rgba(#2c2c2c, 0.12);

$mat-light-theme-background: (
  background: $light-background,
  status-bar: $light-bg-darker-20,
  app-bar: $light-bg-darker-5,
  hover: $dark-bg-alpha-4,
  card: $light-bg-lighter-5,
  dialog: $light-bg-lighter-5,
  tooltip: $dark-bg-tooltip,
  disabled-button: $dark-bg-alpha-12,
  raised-button: $light-bg-lighter-5,
  focused-button: $dark-focused,
  selected-button: $light-bg-darker-20,
  selected-disabled-button: $light-bg-darker-30,
  disabled-button-toggle: $light-bg-darker-10,
  unselected-chip: $light-bg-darker-10,
  disabled-list-option: $light-bg-darker-10,
);

// Dark bg
$dark-background: #2c2c2c;
$dark-bg-lighter-5: lighten($dark-background, 5%);
$dark-bg-lighter-10: lighten($dark-background, 10%);
$dark-bg-lighter-20: lighten($dark-background, 20%);
$dark-bg-lighter-30: lighten($dark-background, 30%);
$light-bg-alpha-4: rgba(#fafafa, 0.04);
$light-bg-alpha-12: rgba(#fafafa, 0.12);

// Background palette for dark themes.
$mat-dark-theme-background: (
  background: $dark-background,
  status-bar: $dark-bg-lighter-20,
  app-bar: $dark-bg-lighter-5,
  hover: $light-bg-alpha-4,
  card: $dark-bg-lighter-5,
  dialog: $dark-bg-lighter-5,
  tooltip: $dark-bg-lighter-20,
  disabled-button: $light-bg-alpha-12,
  raised-button: $dark-bg-lighter-5,
  focused-button: $light-focused,
  selected-button: $dark-bg-lighter-20,
  selected-disabled-button: $dark-bg-lighter-30,
  disabled-button-toggle: $dark-bg-lighter-10,
  unselected-chip: $dark-bg-lighter-20,
  disabled-list-option: $dark-bg-lighter-10,
);


// Compute font config
@include mat-core($fontConfig);

// Theme Config

body {
  --primary-color: $primary-color;
  --primary-lighter-color: #b3d0c3;
  --primary-darker-color: #004724;
  --text-primary-color: #{$light-primary-text};
  --text-primary-lighter-color: #{$dark-primary-text};
  --text-primary-darker-color: #{$light-primary-text};
}

$mat-primary: (
  main: $primary-color,
  lighter: #b3d0c3,
  darker: #004724,
  200: $primary-color,
  // For slide toggle,
  contrast:
    (
      main: $light-primary-text,
      lighter: $dark-primary-text,
      darker: $light-primary-text,
    ),
);
$theme-primary: mat-palette($mat-primary, main, lighter, darker);

body {
  --accent-color: #797979;
  --accent-lighter-color: #d7d7d7;
  --accent-darker-color: #5c5c5c;
  --text-accent-color: #{$light-primary-text};
  --text-accent-lighter-color: #{$dark-primary-text};
  --text-accent-darker-color: #{$light-primary-text};
}

$mat-accent: (
  main: #797979,
  lighter: #d7d7d7,
  darker: #5c5c5c,
  200: #797979,
  // For slide toggle,
  contrast:
    (
      main: $light-primary-text,
      lighter: $dark-primary-text,
      darker: $light-primary-text,
    ),
);
$theme-accent: mat-palette($mat-accent, main, lighter, darker);

body {
  --warn-color: #ff0000;
  --warn-lighter-color: #ffb3b3;
  --warn-darker-color: #ff0000;
  --text-warn-color: #{$light-primary-text};
  --text-warn-lighter-color: #{$dark-primary-text};
  --text-warn-darker-color: #{$light-primary-text};
}

$mat-warn: (
  main: #ff0000,
  lighter: #ffb3b3,
  darker: #ff0000,
  200: #ff0000,
  // For slide toggle,
  contrast:
    (
      main: $light-primary-text,
      lighter: $dark-primary-text,
      darker: $light-primary-text,
    ),
);
$theme-warn: mat-palette($mat-warn, main, lighter, darker);

$theme: mat-light-theme($theme-primary, $theme-accent, $theme-warn);
$altTheme: mat-dark-theme($theme-primary, $theme-accent, $theme-warn);

// Theme Init
@include angular-material-theme($theme);

.theme-alternate {
  @include angular-material-theme($altTheme);
}

// Specific component overrides, pieces that are not in line with the general theming

// Handle buttons appropriately, with respect to line-height
.mat-raised-button,
.mat-stroked-button,
.mat-flat-button {
  padding: 0 1.15em;
  margin: 0 0.65em !important;
  min-width: 3em;
  line-height: 36.4px;
}

.mat-standard-chip {
  padding: 0.5em 0.85em;
  min-height: 2.5em;
}

.material-icons {
  font-size: 24px;
  font-family: "Material Icons", "Material Icons";
  .mat-badge-content {
    font-family: Roboto;
  }
}

/* CUSTOM SCSS */
body {
  background-color: #ececec;
  padding: 0;
  margin: 0;
}
.mat-darky {
  color: rgb(255, 255, 255) !important;
  background-color: #333333 !important;
}

.mat-darky-icon {
  color: #333333 !important;
  background-color: #33333300 !important;
}

.mat-card-content {
  margin-bottom: 0px !important;
}




// campos hidden/show mediaquery
.d-none {
	display: none;
}
.d-block {
  display: block !important;
}
.d-flex {
  display: flex !important;
}
.d-xs {
	display: block !important;
}
@media only screen and (min-width: $sm-viewport) {
	.d-sm {
		display: block !important;
	}
  .d-sm-block {
    display: block !important;
  }
  .d-sm-flex {
    display: flex !important;
  }
}
@media only screen and (min-width: $md-viewport) {
	.d-md {
		display: block !important;
	}
  .d-md-block {
    display: block !important;
  }
  .d-md-flex {
    display: flex !important;
  }  
}
@media only screen and (min-width: $lg-viewport) {
	.d-lg {
		display: block !important;
	}
  .d-lg-block {
    display: block !important;
  }
  .d-lg-flex {
    display: flex !important;
  }
}

/* custom theme */
.separator {
  border-top: solid 1px $lighter-color;
  margin-bottom: 1em;
  margin-top: 0.5em;
  width: calc(100% - 1em);
  margin-left: 0.5em;
  margin-right: 0.5em;
}

.mat-form-field-appearance-legacy {
  .mat-form-field-flex {
    padding: 0.25em 0.75em 0 0.75em;
  }
  &.mat-form-field-disabled .mat-form-field-underline {
    display: none;
  }
} 

.mat-form-field-appearance-fill, 
.mat-form-field-appearance-legacy {  
  .mat-form-field-flex {
    background-color: rgba(0,0,0,0.02);
  }
  &.mat-form-field-disabled {
    .mat-form-field-flex {
     background-color: rgba($primary-color,0.04);
    }
    .mat-form-field-label {
      color: $primary-color;
    }
  }
  .mat-input-element:disabled {
    color: $primary-color;
  }
}

.mat-option {
  height: 42px;
}

.mat-card {
  margin-bottom: 16px;
}
.mat-card-header {
  .mat-card-title {
    display: flex;
    justify-content: space-between;
  }
  .mat-card-header-text {
    width: 100%;
    margin: 0 ;
    border-bottom: solid 1px $lighter-color;
    h2 .mat-icon {
      color: $primary-color;
      padding: 5px;
    }
  }
}

.full-width {
  width: 100%;
}

.mat-form-field.full-width {
  display: block ;
}
.mat-card-title {
  h2 {
    font-family: Roboto,Verdana, Geneva, sans-serif;
    font-weight: 400;
    color: $primary-color;
    margin: 5px 0;
    display: flex;
    align-items: center;
  }
}
.mat-card-header .mat-card-subtitle.breadcrumb {
  display: flex;
  align-items: center;
  padding-left: 36px;
  margin-bottom: 10px;
  margin-top: -16px !important;
  .active {
    color: $black;
  }
  .link {
    color: rgba(0,0,0,.54);
    text-decoration: none;
    cursor: pointer;
  }
}

.no-data {
  padding: 20px;
  color: rgba($black, 0.5);
}

.mantenimiento-filter {
  display: block;
  margin-top: 16px;
  border: solid 1px;
  border-radius: 6px;
  padding: 16px 10px 0 10px;
  border-color: $filter-border;
  background-color: $filter-background;
  .mat-form-field-appearance-fill,
  .mat-form-field-appearance-legacy {
      .mat-form-field-flex {
      background-color: $white !important; 
    }
  }
}
.mantenimiento-content {
  padding-top: 16px;
  padding-bottom: 16px;
}

.mat-expansion-panel-header-title {
  color: $subtitle-color;
  line-height: 1.5rem;
  font-family: Roboto,Verdana, Geneva, sans-serif;
  font-weight: 400;
  .mat-icon {
    padding-right: 10px;
  }
}

.mat-icon-green {
  color: $subtitle-color;
}

.mat-border {
  border: solid 1px $lighter-color;
  border-top: none;
}
.mat-border:first-child,
.mat-border.mat-expanded + .mat-border {
  border-top: solid 1px $lighter-color;
}

.mat-border.mat-expanded {
  border-top: solid 1px $lighter-color;
}

/* table */
.column-grey {
  background-color: rgba($primary-color,0.04);
}

/* buttons */
.mat-flat-button.mat-primary.mat-button-off {
  &.mat-button-off {
    background-color: rgba($primary-color, 0.04);
    color: $primary-color;
  }
  &.mat-button-disabled {
    pointer-events: none;
    cursor: not-allowed;
  }
}

.mat-icon-button.button-input-clear{
  height: 16px !important;
  width: 16px !important;
  .mat-icon {
    font-size: 16px;
  }
}


/* text align */
.mat-input-element {
  font-family: Roboto, Verdana, Geneva, Tahoma, sans-serif !important;
  font-size: 14px !important;
  &.text-right {
    text-align: right;
  }
}

label.label-inline-info {
  padding: 0 .75em;
  display: flex;
  color: $primary-color;
  align-items: center;
  height: 54px;
  color: rgba($primary-color,0.8);
  .mat-icon {
    font-size: 16px;
    height: 16px;
    width: 16px;
    padding-right: 4px;
  }
}

/* toggle */
.toggle-container {
  display: flex;
  flex-direction: column;
  padding: 12px 10.5px;
  .toggle-content {
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-between;
  }
  .toggle-label {
    display: block;
    font-size: 14px;
    padding: 6px 12px 6px 0;
    line-height: 1em;
  }
  .toggle-off {
    padding: 2px 12px 0 0;
    order: 1;
  }
  .mat-disabled + .toggle-off {
    opacity: .38;
  }
  .mat-slide-toggle{
    order: 2;
  }

  &.toggle-label-ontop {
    padding-top: 2px;
    .toggle-content{
      flex-direction: column;
    }
    .toggle-label {
      transform: scale(0.75);
      align-self: flex-start;
      color: rgba(0, 0, 0, 0.6);
      letter-spacing: 1.5px;
      padding-bottom: 0;
    }
  }
}

.toggle-container-align-start{
  align-items: flex-start;
}

/* paneles */
.soft-panel {
  margin: 15px 0;
  padding: 15px;
  background-color: rgba($primary-color,0.04);
}
/* zebra colors */
.table-with-zebra {
  th.mat-header-cell,
  td.mat-cell{
    padding-left: 10px;
  }
}

.zebra-color-1 {
  background-color: $zebra-color-1;
}
.zebra-color-2 {
  background-color: $zebra-color-2;
}

.table-auto-zebra {
  tr {
    -moz-transition: all .1s ease-in;
    -o-transition: all .1s ease-in;
    -webkit-transition: all .1s ease-in;
    transition: all .1s ease-in;
    cursor: default;
  }
  tr:nth-child(odd) {
    background-color: $zebra-color-2;
  }
  tr:nth-child(even) {
    background-color: $zebra-color-1;
  }
  tr th {
    background-color: $white;
    color: $primary-color;
  }
  td.mat-cell:first-of-type {
    padding-left: 0;
  }
  td.mat-cell:last-of-type {
    padding-right: 0;
  }
  tr.mostrado{
    background-color:  $white;
    td {
      color: rgba($black, 0.8);
    }
  }
  tr.actual{
    background-color:  rgba($primary-color,0.8);
    td {
      color: $white
    }
  }
  tr:hover {
    background-color:  rgba($primary-color,1);
    td {
      color: $white
    }
  }

}

/* tablas */
.cell-column {
  display: flex;
  flex-direction: column;
}

.grid-vertical-zebra {
  width: calc(100% - 2px);
  background-color: $white;
  border-collapse: collapse;
  border-width: 0;
  border-style: solid;
  color: $black;  
  
  tr.mat-row, tr.mat-footer-row {
    height: 42px;
  }
  tr:nth-child(even) {
    background-color: $grid-zebra-1;
  }
  th.mat-header-cell:first-of-type, td.mat-cell:first-of-type, td.mat-footer-cell:first-of-type {
    padding-left: 10px;
  }
  th.mat-header-cell{
    font-family: 'Roboto Condensed', Arial, Helvetica, sans-serif;
    font-size: 13px;
    font-weight: 700;
    text-transform: uppercase;
    color: $primary-color;
    white-space: nowrap;
    min-width: 170px;
    .cell-column span {
      justify-content: center;
      text-align: center;
      width: 100%;
      white-space: initial;
      line-height: 1em;
    }
  }
  td.mat-cell  {
    border-width: 1px;
    border-color: $lighter-color;
    border-style: solid;
    padding-left: 10px;
    padding-right: 10px;
    min-width: 170px;
    font-size: 13px;
    font-family: 'Roboto', Arial, Helvetica, sans-serif;
    text-align: center;
  }
}

// totales tablas grid
.grid-total-1 {
  background-color: $grid-total-1;
  padding: 5px 10px;
  font-size: 14px;
  font-weight: 700;
  text-transform: uppercase;
  line-height: 2rem;
  font-family: 'Roboto Condensed', Arial, Helvetica, sans-serif;
}


.subtitle {
  margin-top: 16px;
}

/* overlay */
.overlay {
  position: absolute;
  display: none;
  width: 100%;
  height: 100%;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background-color: rgba(0,0,0,0.5);
  z-index: 2;
  justify-content: center;
  align-items: center;
  &.working {
    display: flex;
  }
}

/* barra de progreso */

.mat-progress-bar.select-progress-bar {
  position: absolute;
  bottom: -2px;
  width: calc(100% + 1.5em);
  left: -0.75em;
  height: 2px;
}

// file dropdown
.container-filedrop {
  font-size: 1rem;
  padding: 1rem;
  text-align: center;
  border: dashed 1px rgba($primary-color,0.4);
  position: relative;
  margin: 0 auto;
  background-color: rgba($primary-color,0.04);
  color: rgba($primary-color,0.4);
  cursor: pointer;

  .mat-icon {
    font-size: 48px;
    height: 48px;
    width: 48px;
    color: rgba($primary-color,0.4);
  }

  input {
    opacity: 0;
    position: absolute;
    z-index: 2;
    width: 100%;
    height: 100%;
    top: 0;
    left: 0;
  }

  label {
    color: $primary-color;
    border-bottom: solid 1px $primary-color;
    cursor: pointer;
  }

  h3 {
    font-size: 20px;
    font-weight: 600;
    color: #38424c;
  }
}

.fileover {
  animation: pulse 1s;
  animation-iteration-count: infinite;
  
}

.files-list {
  margin-top: -1px;
  margin-bottom: 1.5rem;

  .single-file {
    display: flex;
    padding: 0.5rem;
    justify-content: space-between;
    align-items: center;
    border: dashed 1px rgba($primary-color,0.4);
    margin-bottom: -1px;

    img.delete {
      margin-left: 0.5rem;
      cursor: pointer;
      align-self: flex-end;
    }


    display: flex;
    flex-grow: 1;

    .name {
      font-size: 14px;
      font-weight: 500;
      color: #353f4a;
      margin: 0;
      display: flex;
      align-items: center;
    }

    .size {
      font-size: 12px;
      font-weight: 500;
      color: #a4a4a4;
      margin: 0;
      margin-left: 1rem;
    }

    .info {
      width: 100%;
      padding-left: 10px;
      padding-right: 10px;
    }
  }
}

// container group
.container-group {
  border-radius: 5px;
  border: solid 1px #d7d7d7;
  background-color: #fff;
  padding: 0 16px 16px;
  margin-bottom: 16px;
  &.with-padding-top {
    padding-top: 16px;
    padding-bottom: 0;
  }
}
.container-group-accordion {
  border-radius: 5px !important;
  border: solid 1px #d7d7d7;
  background-color: #fff;
  padding: 0 !important;
